import React from 'react';
import './Gallery.css';

const images = [
  { src: require('../img/sembrado1.jpg'), alt: 'Sembrado Ecológico 1' },
  { src: require('../img/sembrado2.jpg'), alt: 'Sembrado Ecológico 2' },
  { src: require('../img/sembrado3.jpg'), alt: 'Sembrado Ecológico 3' },
  { src: require('../img/sembrado4.jpg'), alt: 'Riego Automático' },
  { src: require('../img/sembrado5.jpg'), alt: 'Procesamiento de Residuos Biológicos' },
  { src: require('../img/sembrado6.jpg'), alt: 'Cuidado del Medio Ambiente' },
];


function Gallery() {
  return (
    <div className="gallery">
      <h1>Galería de Imágenes</h1>
      <p>Explora las imágenes destacadas de nuestras actividades y servicios.</p>
      <div className="gallery-grid">
        {images.map((image, index) => (
          <div key={index} className="gallery-item">
            <img src={image.src} alt={image.alt} className="gallery-image" />
          </div>
        ))}
      </div>
    </div>
  );
}

export default Gallery;
